INSERT INTO `faqs` (`faq_id`, `faq_question`, `faq_answer`, `static_arp`) VALUES
(1, 'How to check Internet is working or not in Server?', 'First login in server. After login in server Type this command<br>lynx www.google.com\r\nif it returns output that means internet is working.\r\n', 0),
(2, 'User Connect & Disconnect time shows wrong.', 'Check out System date in server. You can check date in User Management page.\r\nIf server date is found wrong then modify server system date through<br> System->Utilities-->Modify Date', 0),
(3, 'How to modify date in server?', 'In Admin Control Panel -->System menu -->Utility & tools--> Modify Date\r\n', 0),
(4, 'Admin couldn\'t be able to login. Usershow page output not shown in browser.', 'If in URL address show usershow and output not show. That means no user online. All users are offline. Do one thing login in server and type this commnad for change file mode.<br>\r\ncd /sbin\r\nchmod 000 bandmeter\r\n\r\n\r\n\r\n', 0),
(5, 'How to check What is Admin   Password?', 'Type these command in server and check password. <br>\r\n1. mysql -u root -p<br>\r\n2. type password<br>\r\n3. use smartguard; [Note :use semicolon]<br>\r\n4. select * from admin_login ;<br>\r\n\r\n', 0),
(6, 'HTTP  forbidden error comes', 'May be two three reason \r\n1. Check in server Internet is working or not through lynx www.google.com\r\n2. If Internet is working then restart network service', 0),
(7, '28 Got error - comes', 'When free space not found in server. <br>\r\nyou can check free space by command <br>\r\ndf- h <br> or you can check through webmin http://IPADDRESS:10000\r\nEnter your username admin and password. Then Check in DISK AND NETWORK FILESYSTEM\r\n Clear Logs fil', 0),
(8, 'Can\'t connect to local MySQL server through socket  \'/var/lib/mysql/mysql.sock\'.', 'That\'s means mysql corrupt<br>\r\nRepair MySql type these commands.<br>\r\nservice mysqld stop<br>\r\ncd /var/lib/mysql/smartguard/<br>\r\nmyisamchk *.MYI -r -n <br>\r\nservice mysqld start <br>\r\nif mysql repair and this error remove then restart server.\r\n\r\n\r\n', 0),
(9, 'How to Check load Average?', 'w', 0),
(10, 'Mrtg Graph LAN and MAN not display properly', 'If graph not display properly then click on <br>System->MrtgManagement->GenerateNew', 0),
(11, 'MAIL SERVER PROBLEMS', '1. User Couldnot be able to send email.  Mail Server not working.<br>\r\nAns. * Restart mail server. command is <br>service sendmail start <br> or /etc/rc.d/init.d/sendmail start<br>* check any errors.<br>\r\n* Check disk space is available or not.\r\n* If', 0),
(12, 'How to make space in disk ?', 'You can clear log files by System-->Utility tools-->Clear Logs.\r\n', 0),
(13, 'Particular web site not open in a particular user system.', 'Check DNS\r\n', 0),
(14, ' Particular web site not open in client end and also from server.', 'May be block OUR Server IP', 0),
(15, 'Access denied. Your  Cache Administrator is root', '1. Restart Cacahe Server command is  <br>\r\n2. service squid restart<br>\r\n3. if still not working then \r\ncheck server space. \r\n4. Clear log files and logbackup files. \r\n5. Then again restart squid and also restart server.\r\n6. You have to check any err', 0),
(16, 'How to check why Cacahe is not working?', 'Restart squid service and then check any error occurs. \r\nor check error in\r\n<br> cat /var/log/squid/access.log\r\n', 0),
(17, 'User could not be able to connect messenger.', 'Check  User Ports and Package.', 0),
(18, 'Server Crash then how to start system.', 'if its shows you fsck/dev/hda1 error comes\r\nthen fsck /dev/hda1\r\nand Press Y every time.\r\n\r\nIf server crash and it shows you nothing and not start then\r\nrestart you server<br>\r\nPress Ctrl+X <br>\r\ntype linux1 <br>\r\nfsck /dev/hda1 if required \r\n\r\nand p', 0),
(19, 'In user end IP address Conflict error Shows.', 'Two reasons<br>\r\n1. Check same IP address is entered in another machine also.<br>\r\n2. Or if server restart and then shows these error then  \r\nSystem->Network Configuration->Publicip_Support->Click on no\r\n', 0),
(20, 'User Automatically Disconnect after  few minutes.', 'In Usermanagement--useredit-->Check user autodisconnect no or yes. If Hourly package you have to select yes otherwise no.', 0),
(21, 'POP & Messenger not working', 'POP & Messenager Not working. I already check my ports. All ports are selected but still messanger not working.  Everything is working fine <br>\r\nCheck LAN & WAN IP. May be your lan ip and wan ip interchanged', 0),
(22, 'How to Check RAM ?', 'free -m', 0),
(23, 'New User connection not able to browse. User not in cache, still not able to browse.', 'Check the ports in pacakage. If ports are already given but still not able to browse\r\nIn server type the command  <br>arp -n <br>\r\nif user IP Address and MAC address[LAN CARD] not given that means it could not be able to connect. Just ping the user t', 0),
(24, 'When  Server hang.', 'Then reboot server by ctrl+alt+del or hardboot <br>\r\nAfter reboot server it shows you any error \r\n\r\nif its shows you fsck/dev/hda1 error comes\r\n\r\nthen fsck /dev/hda1\r\nand Press Y every time\r\n\r\nIf server crash and it shows nothing and not start then\r\n', 0),
(25, 'In a User\'s end open SmartGuard page when user browsing.', 'Check Mysql Server is working properly.\r\nIf found any error in mysql then repair Mysql and restart server.\r\n', 0),
(26, 'How to repair mysql?', 'cd /var/lib/mysql/smartguard/<br>\r\nservice mysqld stop\r\nmyisamchk -o *.MYI <br>\r\n        or <br>\r\nmyisamchk *.MYI -n -r <br>\r\nservice mysqld start<br>\r\nif mysql server is running properly then restart server.\r\n\r\n\r\n', 0);
